def solution(stdin: str) -> str:
    """Finds the minimum number of moves required to reach a position with an opposite parity to a position where the parity is the same as the parity of the current position.
    """
    n = int(stdin.readline())
    arr = [int(i) for i in stdin.readline().split()]

    odds = []
    evens = []
    for i, num in enumerate(arr):
        if num % 2:
            odds.append(i)
        else:
            evens.append(i)

    # Odd parity
    dp = [0] * n
    dp[-1] = 1
    for i in range(n - 1, -1, -1):
        for j in odds:
            if i - arr[j] >= 0:
                dp[i] = min(dp[i], dp[i - arr[j]])

    # Even parity
    dp_2 = [0] * n
    dp_2[0] = 1
    for i in range(1, n):
        for j in evens:
            if i + arr[j] < n:
                dp_2[i] = min(dp_2[i], dp_2[i + arr[j]])

    # Min of dp and dp_2
    dp_3 = [0] * n
    for i in range(1, n):
        dp_3[i] = min(dp[i], dp_2[i])

    # Print result
    return''.join([str(i) for i in dp_3])

